import React from "react";

const Kategorije = () => {
  return (
    <ul id="predmeti">
      {kategorije.map((kategorija) => (
        <Link to="">
          <li className="predmet">{kategorija.naziv}</li>
        </Link>
      ))}
    </ul>
  );
};

export default Kategorije;
